def invmod(n):
    return pow(n % p, p - 2, p)

def factorial(n):
    r = cached_factorials[n // gap]
    for i in range(max(n - n%gap, 1), n+1):
        r = (r * i) % p
    return r

def factorial_splitmod(n):
    if n < p:
        return factorial(n), 0
    c, y = divmod(n, p)
    r = factorial(y) * (-1)**c
    r1, c1 = factorial_splitmod(c)
    return (r * r1) % p, c + c1

def binom(n, k):
    if not (0 <= k <= n): return 0
    (a, a0), (b, b0), (c, c0) = [factorial_splitmod(x) for x in (n, k, n-k)]
    if b0 + c0 < a0:
        return 0
    else:
        return (a * invmod(b) * invmod(c)) % p

print(binom(n, k))
